import './App.css';
import MainPanel from './components/main-panel/main-panel';
import PanelTop from './components/panel-top/panel-top';
import Sidebar from './components/sidebar/sidebar';

function App() {
  return (
    <div className="App">
      <Sidebar />
      <PanelTop />
      <MainPanel />
    </div>
  );
}

export default App;
